import AnswareInstance from '../model/Answare'
class AnswarePresenter {
    addAnsware(newAnsware) {
       return AnswareInstance.addAnsware(newAnsware);
    }

    removeAnsware(index) {
        return AnswareInstance.removeAnsware(index);
    }

    editAnsware(index, text) {
        return AnswareInstance.editAnsware(index, text);
    }
    getAnsware(index) {
        return AnswareInstance.getAnsware(index);
    }
    getAnswares() {
        return AnswareInstance.getAnswares();
    }

    upvote(index) {
        return AnswareInstance.upvote();
    }

    downvote(index) {
        return AnswareInstance.downvote();
    }

    getVotes(index) {
        return AnswareInstance.getVotes();
    }
}
const AnswarePresenterInstance = new AnswarePresenter();
export default AnswarePresenterInstance;
